import React, { Component } from 'react';

class TableHeader extends Component {
    render() {
        return (
                <thead>
                    <tr>
                        <th>Set #</th>
                        <th>% of max</th>
                        <th>Reps</th>
                        <th>Weight</th>
                    </tr>
                </thead>
        )
    }
}

export default TableHeader;
